description:
काठमाडौंमा बुधबार यस वर्षको पहिलो हिउँदे वर्षा भएको छ ।&amp;nbsp;

पश्चिमी पहाडी जिल्लामा हिमपात हुँदा उपत्यकामा हल्का वर्ष भएको हो ।&amp;nbsp;

बुधबार बिहानबाटै धुम्म रहेको उपत्यकाको मौसम दिनको समय आंशिक बदली भई वर्षा भएको मौसम पूर्वानुमान महाशाखाले

राष्ट्रपति रामचन्द्र पौडेल समक्ष राष्ट्रिय सभा सदस्य निर्वाचनको प्रतिवेदन पेश भएको छ ।&amp;nbsp;

राष्ट्रपति भवन शीतल निवासमा बुधबार आयोजित कार्यक्रममा कार्यवाहक प्रमुख निर्वाचन आयुक्त रामप्रसाद भण्डारीले प्रतिवेदन पेश गरेका हुन् ।&amp;nbsp;

यही माघ
